import React, { Component } from 'react';
import './Shop.scss'
import Product from '../components/product';
// import products from '../menu'
import { Col, Container, Row } from "react-bootstrap";
import { Route } from "react-router-dom";

import { connect } from 'react-redux'
import { selectCollections } from '../redux/shop/shop.selectors';

import ShopProduct from "./ShopProduct";
import SpecificProduct from "./SpecificProduct";
import { selectShopIterms } from '../redux/shop/shop.selectors'
import { createStructuredSelector } from 'reselect';

import CollectionOverview from '../components/CollectionOverview'

const Shop = ({ collections }) => (

    <Container fluid className='container'>
        <Row className="justify-content-md-center">
            {collections.map(({ id, ...otherCollectionProps }) => (
                <Col s={12} md={4} key={id} className=' product'>
                    <CollectionOverview key={id} {...otherCollectionProps} />
                    {/* <Route exact path={`${match.path}`} component={ShopProduct} />
                    <Route path={`${match.path}/:specificProductId`} component={SpecificProduct} /> */}
                    {/* <ShopProduct
                        key={item.id}
                        linkUrl={item.linkUrl}
                        item={item}
                    /> */}
                    {/* </Link> */}
                </Col>
            ))}
        </Row>
    </Container>
);

const mapStateToProps = createStructuredSelector({
    collections: selectCollections
})

export default connect(mapStateToProps)(Shop);
